import useForm from './hooks/useForm';
import Input from './components/Input';
import Card from './components/Card';
import Container from './components/Container';

const App = () => {
  const [form, handleChange] = useForm({
    name: '',
    lastname: '',
    email: ''
  });

  return (
    <Container>
      <Card>
        <form>
          <Input
            label='Name'
            name='name'
            value={form.name}
            onChange={handleChange} />
          <Input
            label='Last name'
            name='lastname'
            value={form.lastname}
            onChange={handleChange} />
          <Input
            label='Email'
            name='email'
            value={form.email}
            onChange={handleChange} />
        </form>
      </Card>
    </Container>
  );
}

export default App;
